import React from 'react'
import ReactDOM from 'react-dom'
import './style.scss'
import BottomPlayer from './bottom-player'
import {
  QueueIcon,
  PauseIcon,
  PlayIcon,
  RepeatIcon,
  Repeat1Icon,
  SettingsIcon,
  ShuffleIcon,
  StepBackIcon,
  StepFwdIcon,
  VolumeOffIcon,
  VolumeLowIcon,
  VolumeMedIcon,
  VolumeHighIcon,
} from './icons'

class Root extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      audio: new Audio('https://picardia.co/mouseion/songs/f3b7681372e8f95117aef9388590a3942f0bc64d.mp3')
    }
    this.state.audio.addEventListener('timeupdate', () => {
      this.setState({})
    })
  }

  render () { return (<>
    <Navbar/>
    <BottomPlayer audio={this.state.audio}/>
    <MainContent/>
  </>) }
}

class Navbar extends React.Component {
  render () { return (<div>
    <p>Base</p>
    <p class="hidden sm:block">Base</p>
    <p class="hidden sm:block">Small</p>
    <p class="hidden sm:block">Medium</p>
    <p class="hidden sm:block">Large</p>
    <p class="hidden sm:block">X Large</p>
    <p class="hidden sm:block">2x Lage</p>
  </div>) }
}

class MainContent extends React.Component {
  render () { return null }
}

ReactDOM.render(
  <React.StrictMode>
    <Root/>
  </React.StrictMode>,
  document.body
)
